I corpi bandistici militari sono bande musicali, i cui esecutori sono musicisti di professione, tutti diplomati in conservatori o istituti musicali pareggiati appartenenti ad un corpo militare.Gli organici vanno fino a un massimo di 100 elementi. Tutti i complessi sono formati da soli strumenti a fiato e a percussione (eccezione fatta per la banda musicale della Polizia di Stato, seppur non militare, che annovera un orchestrale addetto alla chitarra). Le esibizioni, avvengono in: 
* marcia con sfilate: comprende musica bandistica, con marce militari e civili; 
* in teatri o auditorium: comprende musica operistica, arrangiamenti da balletti e sinfonie per orchestra. Tutte le bande, che sono da considerarsi orchestre a fiati, si esibiscono in Italia e all'estero, con largo successo e incidendo CD e video.
